import React, { Component } from 'react'
import styled from 'styled-components'
const Bar = styled.div`
    display: grid;
    grid-template-columns: 180px auto 100px 100px;
`
export class AppBar extends Component {
    render() {
        return (
            <Bar>
                <div>CrytoDash</div>
                <div/>
                <div>Dashboard</div>
                <div>Settings</div>
            </Bar>
        )
    }
}

export default AppBar;
